import React from "react";
import ReactDOM from "react-dom";
import Link from "next/link";
import { Menu, Input, Button } from "antd";

const { Search } = Input;

const AppLayout = ({ children }) => {
    return (
        <>
            <Menu mode="horizontal">
                <Menu.Item key="home">
                    <Link href="/index">
                        <a>Home</a>
                    </Link>
                </Menu.Item>
                <Menu.Item key="profile">
                    <Link href="/profile">
                        <a>Profile</a>
                    </Link>
                </Menu.Item>
                <Search placeholder="input search text" onSearch={(value) => console.log(value)} style={{ width: 200, verticalAlign: "middle" }} />
            </Menu>
            <Link href="/signup">
                <a>
                    <Button>회원가입</Button>
                </a>
            </Link>
            {children}
        </>
    );
};

export default AppLayout;
